import styled from "styled-components";

export const MenuConteiner = styled.div`
  font-family: "TTFirsNeue400";
  margin: 50px auto 19px;
  width: 647px;
  height: 17px;
  display: flex;
  justify-content: space-between;
  @media (max-width: 768px) {
    display: none;
  }
`;

export const ButtonConteiner = styled.div`
  font-size: 14px;
  align-items: center;
  display: flex;
  cursor: pointer;
  line-height: 1.2em;
  /* color: ${(props) => (props.StyledProps ? "rgb(148, 144, 144)" : "white")};
  content: "33";
  fill: ${(props) => (props.StyledProps ? "rgb(148, 144, 144)" : "white")}; */
`;
